import React, {Component} from 'react'
import './OptionsList.css'
import RouteLink from '../components/RouteLink'

class OptionsList extends Component {
    constructor(props) {
        super(props);

        this.optionsArray = this.props.optionsList.map((option,i) => {
            console.log(this.props.linkClass)
            return(
                <li key={i} className={this.props.itemClass}>
                <RouteLink 
                    className={this.props.linkClass}
                    text={option.text}
                    routeFunction={this.props.routeFunction}
                    newRoute={option.newRoute}
                />
                </li>
            )
        })
    }

    render() {
        return(
            <ul id={this.props.listClass}>
                {this.optionsArray}
            </ul>
        )
    }
}

export default OptionsList;
